import React from 'react';

import MoviesTemp from './MoviesTemp';
import classes from './MovieListTemp.module.css';

const MovieListTemp = (props) => {
    return (
        <ul className={classes['movies-list']}>
            {props.movies.map((movie) => (
                <MoviesTemp
                    key={movie.id}
                    title={movie.title}
                    releaseDate={movie.releaseDate}
                    openingText={movie.openingText}
                />
            ))}
        </ul>
    );
};

export default MovieListTemp;
